import React, { Component } from 'react'


export default class Page extends Component {

    handlekey = (event) => {
        if(event.key === 'Enter'){
            alert('worked')
        }

    };

    render() {
        const words = [
            'one',
            'two',
            'three'
        ];


    return (
      <div>
        {words.map(item =>{
            return <h1>{item}</h1>
        })}
        <input type='text' onKeyPress={ this.handlekey } />
      </div>
    )
  }
}

